import React, { useState } from 'react';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

import './Manual.css';

function Manual() {
  const [textButton, setTextColor] = useState('Start');
  return (
    <form className="manual-irrigation-form">
      <TextField id="minutes-input" label="Minutes" variant="outlined" />
      <Button
        id="breathing-button"
        className="manual-button"
        variant="contained"
        color="primary"
        type="submit"
      >
        {textButton}
      </Button>
    </form>
  );
}

export default Manual;
